	@RequestMapping(value="/getAllStreetCredNewImages.htm",method=RequestMethod.GET)
	public @ResponseBody List getAllStreetCredNewImages(@RequestParam("offset") String offset, HttpServletRequest req,HttpServletResponse resp)
	{
		log.info("**** Inside the getAllStreetCredNewImages controller ****");
		
		resp.addHeader("Access-Control-Allow-Origin", "*");
		resp.setHeader("Access-Control-Allow-Methods", "GET");
        resp.setHeader("Access-Control-Max-Age", "3600");
        
        resp.setContentType("application/json");
		
		StreetCredFeed scf= new StreetCredFeed();
		PersistenceManager pm=null; 
		StreetCredManagerService sms= new StreetCredManagerService();
		
		List<StreetCredFeed>  retval = null;
		try
		{
//			  retval=(List<StreetCredFeed>)sms.getAllStreetCredDeniedImages();
			 	pm=PMF.get().getPersistenceManager();
				javax.jdo.Query query1 = pm.newQuery("select from "+StreetCredFeed.class.getName()+" where deleted == false && status == 'New'");				
//				query1.setFilter("deleted==false && status == 'New'"); 
				query1.setOrdering("milliseconds desc");
				query1.setRange(Long.parseLong(offset), Long.parseLong(offset)+200);
				
				List<StreetCredFeed> ret= (List<StreetCredFeed>) query1.execute();
				retval=(List<StreetCredFeed>)pm.detachCopyAll(ret);
				log.info("Result size"+retval.size());
		}
		
		catch(Exception e)
		{
			log.warning("Exception in getAllStreetCredNewImages()"+e.getMessage());
			new BusinessException("Exception in getAllStreetCredNewImages :"+e.getMessage(),e.getStackTrace());
		}
		
		return retval;
	}
	
	@RequestMapping(value="/getAllStreetCredDeniedImages.htm",method=RequestMethod.GET)
	public @ResponseBody List getAllStreetCredDeniedImages(HttpServletRequest req,HttpServletResponse resp)
	{
		log.info("**** Inside the getAllStreetCredDeniedImages controller ****");
		
		StreetCredFeed scf= new StreetCredFeed();
		PersistenceManager pm=null; 
		StreetCredManagerService sms= new StreetCredManagerService();
		
		List<StreetCredFeed>  retval = null;
		try
		{
//			  retval=(List<StreetCredFeed>)sms.getAllStreetCredDeniedImages();
			 	pm=PMF.get().getPersistenceManager();
				javax.jdo.Query query1 = pm.newQuery(StreetCredFeed.class);				
				query1.setFilter("deleted==false && status=='denied'");
				List<StreetCredFeed> ret= (List<StreetCredFeed>) query1.execute();
				retval=(List<StreetCredFeed>)pm.detachCopyAll(ret);
				log.info("Result size"+retval.size()); 
		}
		
		catch(Exception e)
		{
			log.warning("Exception in getAllStreetCredDeniedImages()"+e.getMessage());
			new BusinessException("Exception in getAllStreetCredDeniedImages :"+e.getMessage(),e.getStackTrace());
		}
		
		return retval;
	}
	
	
