	@RequestMapping(value="/updateStreetImgStatus.htm")
	public void updateStreetImgStatus(@RequestParam(value="status") String status, @RequestParam(value="postId") String postId, HttpServletRequest req,HttpServletResponse resp)
	{
		resp.addHeader("Access-Control-Allow-Origin", "*");
		resp.setHeader("Access-Control-Allow-Methods", "GET");
        resp.setHeader("Access-Control-Max-Age", "3600");
        
        resp.setContentType("application/json");
        
        PersistenceManager pm			=	PMF.get().getPersistenceManager();
        
        try 
        {
        	javax.jdo.Query query					=	pm.newQuery(StreetCredFeed.class,"key == "+postId);
        	List<StreetCredFeed> feedList			=	(List<StreetCredFeed>) query.execute();
        	
        	if(feedList != null && feedList.size() > 0)
        	{
        		for(StreetCredFeed feed : feedList)
        		{
        			if(status != null)
        			{
        				if(status.equals("delete"))
        				{
        					feed.setDeleted(true);
        				}
        				else
        				{
        					feed.setStatus(status);
        				}
        				log.info("inside the update image status with time");
        				feed.setDateModified(new Date().getTime());
        				
        				pm.currentTransaction().begin();
                        pm.makePersistent(feed);
                        pm.currentTransaction().commit();
        			}
        		}
        	}
            
        	
        }
        catch(Exception e)
        {
        	log.info("Some exception occured");
        	e.printStackTrace();
        }
        finally
        {
        	pm.close();
        }
	}
	
