	@RequestMapping(value="/removePrivateImages.htm")
	public void removePrivateImages(@RequestParam(value="id")String id , HttpServletRequest req, HttpServletResponse resp)
	{
		log.info("id::"+id);
		StreetCredFeed feedId					= 	null;
		PersistenceManager pm					=	PMF.get().getPersistenceManager();
		try
		{
			if(id !=null)
			{
				Key key 	=	 KeyFactory.createKey(StreetCredFeed.class.getSimpleName(), Long.parseLong(id));
				feedId		=	(StreetCredFeed) pm.getObjectById(StreetCredFeed.class,key);
				feedId.setDeleted(true);
				pm.makePersistent(feedId);
			}
			
		}
		catch(Exception e)
		{
			e.printStackTrace();
		}
		finally
		{
			pm.close();
		}
		
	}
	
